/** 
 * Writes the compressed layer BLOB to a file and returns a  {@link CachedLayer} that representsthe new cached layer.
 */
public CachedLayer writeTo(File file) throws IOException {
  try (OutputStream fileOutputStream=new BufferedOutputStream(new FileOutputStream(file))){
    OutputStream new GZIPOutputStream(fileOutputStream)=new GZIPOutputStream(fileOutputStream);
    BlobDescriptor blobDescriptor=uncompressedBlob.writeTo(new GZIPOutputStream(fileOutputStream));
    DescriptorDigest diffId=uncompressedBlob.writeTo(ByteStreams.nullOutputStream()).getDigest();
    return new CachedLayer(file,blobDescriptor,diffId);
  }
 }
